$count in mongodb under aggregation framkework<p>I need to write a code that solves the following question:</p>

<blockquote>
  <p>On genres, get the top actors who have participated in more genres.</p>
</blockquote>

<p>I start from the following .json file: <a href="https://drive.google.com/file/d/1VKuhce2ofjLjYEoND_Fz2wqcYHAf6kkZ/view" rel="nofollow noreferrer">https://drive.google.com/file/d/1VKuhce2ofjLjYEoND_Fz2wqcYHAf6kkZ/view</a></p>

<p>So I created the <em>genres</em> collection:</p>

<pre><code> //unwind
    db.getCollection("actors").find({})
    fase1 = { $unwind: "$genres"}
    etapas = [fase1]
    db.Tarea.aggregate( etapas )

    //out
    fase1 = { $unwind: "$genres" }
    query2 = { "_id": 0 }
    fase2 = { $project: query2 }
    fase3 = { $out: "genres" }
    etapas = [ fase1, fase2, fase3 ]
    db.actors.aggregate( etapas )
</code></pre>

<p>Then I tried to aggregate them. And I would say that I practically have it, only that I need the count that appears in "numgeneros" to be the count of genres for each actor</p>

<pre><code>db.genres.aggregate([
   {$match: { 
       "genres" : {$ne:"Undefined"},
       "cast" : {$ne:"Undefined"}
       }},

       {$group: {
            _id: "$cast",
            numgeneros: {$count: "$genres"},
            genres: { $addToSet: "$genres"}
       }},
       {$sort: {numgeneros:-1}},
    {$limit:10}
])
</code></pre>

<p>This is what I get:</p>

<p><a href="https://i.stack.imgur.com/rEjBt.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/rEjBt.png" alt="enter image description here"></a></p>

<p>And what I need is that, for example, the count of Harold Lloyd is equal to 4, which is the number of genres in which it appears instead of 236.</p>

<p><strong>Thanks to everyone beforehand!</strong></p>

<p><strong>@RLD Solution</strong> works perfectly:</p>

<p><a href="https://i.stack.imgur.com/u25iD.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/u25iD.png" alt="enter image description here"></a></p>

