How to add a sub-document (if not exists) to an array field, in MongoDB using Java?<p>I'm having issues with a really simple task, in Java:
I need to get "users" array inside an object,</p>

<p>Check if it contains a key ID, and if not, add a new user to the array.
I don't get any error, but the user isn't added.</p>

<p>Please, answer using the Java driver.
Why is that? Here is the code:</p>

<pre><code>List&lt;DBObject&gt; queryResultList = cursor.toArray(1);
DBObject currentObj = queryResultList.get(0);
Set userIdsKeySet = ((BasicDBObject) currentObj.get("users")).keySet();
BasicDBObject newObj = null;
if(!userIdsKeySet.contains(userId)){
    ((BasicDBList)currentObj.get("users")).add(new BasicDBObject().append(userId, user));
}
if(newObj != null) {
    collection.update(currentObj, new BasicDBObject("users", newObj));
    return true;
}
</code></pre>

<p>The document structure looks like that:</p>

<pre><code>{
    "_id": "5de9604ef36d7f394a4ade2f",
    "_index": "sw0dfb0",
    "users": [{
        "e9604ef36d94a4ade7f394": {
            "some_field": "abcde"
        }
    }]
}
</code></pre>

<p>Is it a better way to make the users array this way?</p>

<pre><code>"users": [{
     "user_id":"e9604ef36d94a4ade7f394",
     "some_field":"abcde"
}]
</code></pre>

<p><strong><em>Note:</em></strong> I Know there are much prettier and simpler ways to do it, any informative advice is welcome.</p>

