How to retrieve currentUser data with Vue.js, Vuex, Express, MongoDB<p>I am attempting to build a MEVN stack authentication page that returns information on the currently logged-in user. Upon logging in, the router re-directs to the Home.vue while passing the <code>username</code> to the Home.vue as a prop.</p>

<p>onSubmit method in Login.vue</p>

<pre><code>&lt;script&gt;
  methods: {
    onSubmit (evt) {
      evt.preventDefault()
      axios.post(`http://localhost:3000/api/auth/login/`, this.login)
        .then(response =&gt; {
          localStorage.setItem('jwtToken', response.data.token)
          this.$router.push({
            name: 'BookList',
            params: { username: this.login.username }
          })
        })
        .catch(e =&gt; {
          this.errors.push(e)
        })
      },
      register () {
        this.$router.push({
          name: 'Register'
        })
      }
    }
  }
  &lt;/script&gt;

</code></pre>

<p>A Vuex action is then dispatched in the Home.vue component, which passes the username to an action handler in store.js</p>

<p>Instance in Home.vue</p>

<pre><code>import axios from 'axios'
import { mapState } from 'vuex'
export default {
  name: 'BookList',
  props: ['username'],
  data () {
    return {
      errors: []
    }
  },
  computed: mapState([
    'users'
  ]),
  created () {
    this.$store.dispatch('setUsers', this.username)
  }
}
&lt;/script&gt;
</code></pre>

<p>store.js</p>

<pre><code>import Vue from 'vue'
import Vuex from 'vuex'
import axios from 'axios'

Vue.use(Vuex)

export default new Vuex.Store({
  state: {
    users: [],
  },
  mutations: {
    setUsers: (state, users) =&gt; {
      state.users = users
    }
  },
  actions: {
    setUsers: async (context, username) =&gt; {
      let uri = `http://localhost:3000/api/auth/currentuser?username=${username}`
      const response = await axios.get(uri)
      context.commit('setUsers', response.data)
    }
  }
})
</code></pre>

<p>The store requests the username of the logged-in user from an Express route set up to search for the logged-in user based on a URL with <code>username</code> as a query:</p>

<p><code>http://localhost:3000/api/auth/currentuser?username=${username}</code></p>

<p>Express Route</p>

<pre><code>router.get('/currentuser', function(req, res) {
  let params = {},
  username = req.query.username
  if (username) {
     params.username = username
  }
  User.find(params, function (err, users) {
    if (err) return next(err);
    res.json(users);
  });
});
</code></pre>

<p>The username of the logged-in user is successfully retrieved and returned to the template:</p>

<pre><code>      &lt;table style="width:100%"&gt;
        &lt;tr&gt;
          &lt;th&gt;Logged in User&lt;/th&gt;
        &lt;/tr&gt;
        &lt;tr v-for="user in users" :key="user._id"&gt;
          &lt;td&gt;{{ user.username }}&lt;/td&gt;
        &lt;/tr&gt;
      &lt;/table&gt;
</code></pre>

<p>HOWEVER...as soon as I refresh the browser, the username disappears. Any idea why the name does not stay on the screen? Does it have something to do with the username being passed into Home.vue as a prop? Instead of passing the username prop all the way to:</p>

<pre><code>http://localhost:3000/api/auth/currentuser?username=${username}
</code></pre>

<p>...is there perhaps another way that I could pass the username of the logged-in user as a query in the URL?</p>

<p>UPDATED STORE.JS </p>

<pre><code>import Vue from 'vue'
import Vuex from 'vuex'
import axios from 'axios'
import VuexPersistence from 'vuex-persist'

const vuexLocal = new VuexPersistence({
  storage: window.localStorage
})

Vue.use(Vuex)

export default new Vuex.Store({
  state: {
    users: [],
  },
  mutations: {
    setUsers: (state, users) =&gt; {
      state.users = users
    }
  },
  actions: {
    setUsers: async (context, username) =&gt; {
      let uri = `http://localhost:3000/api/auth?username=${username}`
      const response = await axios.get(uri)
      context.commit('setUsers', response.data)
    }
  },
  plugins: [vuexLocal.plugin]
})

</code></pre>

