Querying and sorting a large amount of data in mongo, by fields which might not exist<p>I'm relatively new to mongo and I have a collection that looks like this:</p>

<pre><code>[
    {
        "stored": {
            "box": [
                {
                    "parcelId": "uwb1",
                    "status": "ACTIVE"
                }
            ]
        },
        "checked": {
            "box": [
                {
                    "parcelId": "uwb1",
                    "status": "ACTIVE"
                }
            ]
        }
    },
    {
        "stored": {
            "box": [
                {
                    "parcelId": "aqrf123",
                    "status": "PENDING"
                }
            ]
        },
        "checked": {
            "box": [
                {
                    "parcelId": "aqrf123",
                    "status": "PENDING"
                }
            ]
        }
    },
    {
        "checked": {
            "box": [
                {
                    "parcelId": "zuz873",
                    "status": "ACTIVE"
                }
            ]
        }
    }
]
</code></pre>

<p><strong>Some observations regarding the data:</strong></p>

<ul>
<li>the document will always have the <code>checked</code> field but might not have the <code>stored</code> field</li>
<li>the <code>checked</code> and <code>stored</code> fields have the same schema</li>
<li>both will always have the <code>box</code> field and we can make the assumption that the <code>box</code> field will always have 1 element in the array (only 1, not more, not less)</li>
<li>the amount of documents in this collection is relatively high (~100 mil)</li>
</ul>

<p><strong>What I'm trying to achieve</strong> is to get the documents sorted by that <code>status</code> field, which is like an enum, and it can have 3 values - <code>ACTIVE</code>, <code>PENDING</code> and <code>REJECTED</code>.</p>

<ul>
<li>If for a document, the <code>stored</code> field exist, I'll take it from there and disregard the <code>checked</code> field. </li>
<li>Otherwise I'm going to have to take it from the <code>checked</code> field, which is guaranteed to exist, as previously mentioned.</li>
<li>An important requirement is to have the entire document returned to the consumer / client, so I cannot use <code>projection</code> to reduce the amount of data from the documents (which would probably make the whole operation faster).</li>
</ul>

<p><strong>How I've tried to achieve</strong> this is by using an aggregation which looks like this:</p>

<pre><code>db.getCollection('entries')
    .aggregate([{
            $addFields: {
                sortStatus: {
                    $ifNull: [{
                        $let: {
                            vars: {
                                box: {
                                    $arrayElemAt: [
                                        "$stored.box", 0
                                    ]
                                }
                            },
                            in: "$$box.status"
                        }
                    }, {
                        $let: {
                            vars: {
                                box: {
                                    $arrayElemAt: [
                                        "$checked.box", 0
                                    ]
                                }
                            },
                            in: "$$box.status"
                        }
                    }]
                }
            }
        },
        {
            $sort: {
                sortStatus: 1
            }
        }
    ], {
        allowDiskUse: true
    })
</code></pre>

<p>Which seems to do the job but it feels quite slow. Also there's the <code>allowDiskUse</code> which makes me uncomfortable a bit. If I leave it out, I get the <code>Sort exceeded memory limit of x bytes, but did not opt in to external sorting. Aborting operation. Pass allowDiskUse:true to opt in</code> error message.</p>

<p><strong>So my questions are:</strong></p>

<ol>
<li>Are there faster alternatives, be it with or without aggregation?</li>
<li>Are there any risks in using the <code>allowDiskUse</code> option when doing an aggregation?</li>
<li>Would it be better (or is it the "mongo" way) to alter a bit the document structure and add that sortable field to the root of the document, add an index for it and just use <code>.sort({"statusField": 1})</code>? This would be the last resort option, as I'd have to migrate the existing data.</li>
</ol>

