Upload file to MongoDB and to a local server with the same POST request<p>I'm trying to make my own upload service, and I want to be able to upload a file in a local folder on my server but also on my mongoDB cloud service (Atlas). </p>

<p>So far, I've done both services separately and they work fine (I made a Node app for uploading files to mongo Atlas and another Node app for uploading files to the server). But now, I would like to unifiy these two into a single node app, where after each POST request, the file gets sent to both Atlas as well as the local folder. I'm using multer and gridfs.</p>

<p>The first attempt was to make two "file-input" fields on my index.html file, and each of those with two different POST requests: one to '/upload' which sends the file to Atlas and the second one to '/uploaddisk' which sends the file to disk. However, the second post request doesn't work (it throws me the error every time I want to submit my file). Uploading the file to mongoDB seems to work just fine every time.</p>

<p>Any ideas how can I do this on a single POST ? Thank you in advance!</p>

<p>Here is the code that I wrote for my <code>server.js</code> app:</p>

<pre><code>//mongo DATA
const dbURI =
    "myc-atlas-credentials";
mongoose.Promise = global.Promise;
// mongoose.connect(bdURI, { useNewUrlParser: true, useUnifiedTopology: true });
const conn = mongoose.createConnection(dbURI, {
    useNewUrlParser: true,
    useUnifiedTopology: true
});

//init gfs
let gfs;

conn.once("open", () =&gt; {
    //initialize the stream
    gfs = Grid(conn.db, mongoose.mongo);
    gfs.collection("uploads");
});

//creating the storage engine for MONGO
const storage = new GridFsStorage({
    url: dbURI,
    file: (req, file) =&gt; {
        return new Promise((resolve, reject) =&gt; {
            const filename = file.fieldname + '-' + Date.now() + path.extname(file.originalname);
            const fileInfo = {
                filename: filename,
                bucketName: "uploads"
            };
            resolve(fileInfo);
        });
    }
});
const upload = multer({ storage: storage });

//set storage engine with multer for disk
const diskstorage = multer.diskStorage({
    destination: function(req, file, cb) {
        cb(null, path.join(__dirname + '/uploads/'));
    },
    filename: function(req, file, cb) {
        cb(null, file.fieldname + '-' + Date.now() + path.extname(file.originalname));
    }
});
const diskupload = multer({ storage: diskstorage });

//route for POST - upload data to mongo
app.post('/upload', upload.single('file'), (req, res) =&gt; {
    console.log({ file: req.file });
    // res.json({ file: req.file });
    res.redirect('/');
});

//route for POST - upload data to disk
app.post('/uploaddisk', diskupload.single('file'), (req, res, next) =&gt; {
    const file = { file: req.file };
    if (!file) {
        const error = new Error('Please upload a file');
        error.httpStatusCode = 400;
        return next(error);
    }
    res.redirect('/');
});


</code></pre>

