MongoDB 4.2 combine aggregation pipeline update with array filters<p>I saw that MongoDB 4.2 introduces aggregation pipeline updates, which allows you to set document fields based on other fields in the document.</p>

<p>Considering the following document</p>

<pre><code>{
    ean: "12345",
    orderedQty: 2,
    fulfilledQty: 1,
    "status": "pending"
}
</code></pre>

<p>I could use the following command to increment the fulfilledQty by 1 and if the orderedQty matches the fulfilledQty set the status accordingly:</p>

<pre><code>db.collection.findOneAndUpdate({}, [
  {
    "$set": {
        "orderedQty": {
            "$add": [ "$fulfilledQty", 1 ]
        }
    },  
    "$set": {
      "status": {
        "$cond": {
          "if": { "$eq": ["$orderedQty", "$fulfilledQty"] },
          "then": "fulfilled",
          "else": "pending"
        }
      }
    }
  }
])
</code></pre>

<p>My question: How would i perform this on an array. Say I have a document like this:</p>

<pre><code>_id: "test",
items: [
    {ean: "12345", orderedQty: 2, fulfilledQty: 1, "status": "pending"},
    {ean: "67891", orderedQty: 1, fulfilledQty: 1, "status": "fulfilled"}
]
</code></pre>

<p>Given I have the params <code>ean = 12345</code> and an increase value by 1. How could I target the specific array item with EAN 12345, increase the fulfilledQty by 1 and set the status? I want to only chance the status field and fulfilledQty field and leave the rest of the items array as is. So expected outcome would be:</p>

<pre><code>_id: "test",
items: [
    {ean: "12345", orderedQty: 2, fulfilledQty: 2, "status": "fulfilled"},
    {ean: "67891", orderedQty: 1, fulfilledQty: 1, "status": "fulfilled"}
]
</code></pre>

