Apollo Client - fetchMore component update problem<p>In my <em>NextJS</em> application interfaced with a <em>MongoDB</em> API back-end - managed via <em>GraphQL</em>, I'm trying to implement the <em>Apollo</em> <code>fetchMore</code> feature, in order to update a component responsible to load more items from a data collection.</p>

<p>On page rendering, the component itself shows a "gallery" of 10 elements as its native functionality, populated via a GraphQL starting query. Then, I included a "load more" button to trigger the <code>fetchMore</code> function. The UX expects that if the user clicks the proper button, more 10 elements will going to be loaded in addition of the previous 10 - basically a classical async-infinite loading example.</p>

<p>By inspecting the app, I notice that both the queries are being returned successfully - the initialization one and the "load more 10 items" too managed by <code>fetchMore</code> - but the latter, after its execution, triggers the component's update that it's being re-initialized with the starter query instead of the <code>fetchMore</code> one. </p>

<p>To clarify it: on "load more" click, instead to see the next 10 gallery elements loaded - so to finally display a total of 20 - the component refreshes and displays the starter 10 elements, like its starting initialization - totally ignoring the <code>fetchMore</code> action, even if this one is being called, executed and received back with a populated 200 response.</p>

<p>Because this is my very first time in using it, I don't know if I'm missing something in my implementation, or I need to fix something. Anyway, here it goes:</p>

<p>Due to various reasons, I'm running the query in a parent component, then I pass the data as props to a child one:</p>

<p><strong>Parent</strong></p>

<pre><code>// Initialization, etc.
[...]

const {loading: loadingIndex, error: errorIndex, data: dataIndex, fetchMore: fetchMoreIndex} = useQuery(ARTICLE_QUERY.articles.indexArticles, {
    // Last 30 days
    variables: {
      live: live,
      limit: 10
    }
  });

  // Exception check
  if (errorIndex) {
    return &lt;ErrorDb error={errorIndex} /&gt;
  }
  // DB fetching check
  if (loadingIndex) {
    return (
      &lt;section className="index-articles"&gt;
        &lt;h6&gt;Index - Articles&lt;/h6&gt;
        &lt;aside className="articles__loading"&gt;
          &lt;h6&gt;Loading&lt;/h6&gt;
        &lt;/aside&gt;
      &lt;/section&gt;
    );
  }

  const articles = dataIndex.queryArticleContents;

  return (
    &lt;IndexArticles labels={props.labels} articles={articles} fetchMore={fetchMoreIndex} /&gt;
  );
</code></pre>

<p><strong>Child</strong></p>

<pre><code>// Initialization, etc.
[...]

let limit = 10; // My query hypothetically limiter
const IndexArticles = (props) =&gt; {
  useEffect(() =&gt; {
    // This is a getter method responsible to manage the ```fetchMore``` response
    getArticles(props.articles, props.fetchMore);
  });

return (
    &lt;&gt;
     // Component sections
    [...]

     // Load button
    {props.fetchMore &amp;&amp;
          &lt;button className="articles__load" title={props.labels.index.title} tabIndex={40}&gt;{props.labels.index.cta}&lt;/button&gt;
        }
    &lt;/&gt;
);

function getArticles(articles, fetchMore) {
  // Yes, I'm using jQuery with React. Just ignore it
  $('.articles__load').on('click tap', function(e) {
    e.preventDefault();

    $(this).addClass('hidden');
    $('.articles__loading').removeClass('hidden');

    fetchMore({
      variables: {
        // Cursor is being pointed to the last available element of the current collection
        lastLoaded: articles.length,
        limit: limit += 10
      },
      updateQuery: (prev, {fetchMoreResult, ...rest}) =&gt; {
        $('.articles__loading').addClass('hidden');
        $(this).removeClass('hidden');

        if (!fetchMoreResult) {
          return prev;
        }

        return {
          ...fetchMoreResult,
          queryArticleContents: [
            ...prev.queryArticleContents,
            ...fetchMoreResult.queryArticleContents
          ]
        }
      }
    });
  });
}
</code></pre>

<p>Anyone have experience with it or had experienced this case before?</p>

<p>Thanks in advance for the help</p>

