Why is addToSet in mongodb not working in an array field?<p>The documents in the collection have an array field of sub-documents, each with a counter that should be increased up to three, but if the array doesn't have a sub-document with a given key it should create it with the default values.</p>

<p>The documentation for <a href="https://docs.mongodb.com/manual/reference/operator/update/addToSet/" rel="nofollow noreferrer">$addToSet</a> says:</p>

<blockquote>
  <p><strong>Behavior</strong></p>

  <p>$addToSet only ensures that there are no duplicate items added to the set and does not affect existing duplicate elements. $addToSet does not guarantee a particular ordering of elements in the modified set.</p>

  <p><strong>Missing Field</strong></p>

  <p>If you use $addToSet on a field is absent in the document to update, $addToSet creates the array field with the specified value as its element.  </p>
</blockquote>

<p>The problem is that the array field is not created in the document if it doesn't exist, as stated in the documentation.</p>

<p>This is what I'm currently using to accomplish the operation: </p>

<pre><code>// increase counter in element of array if element exist and counter is less than 3
collection.updateOne({
        key_1,
        "array.key_2": key_2,
        "array.counter": {$lt: 3}
    }, {
        $inc: {"array.$.counter": 1}
    })
    .then(res =&gt; {
        console.log("!!!!1:", res.modifiedCount, res.upsertedId, res.upsertedCount, res.matchedCount);

        if (res.matchedCount) return res.matchedCount;

        // create element in array with the default values,
        // also create the array field if it doesn't exist
        collection.updateOne({
                key_1
            }, {
                $addToSet: {
                    array: {key_2, counter: 1}
                }
            })
            .then(res =&gt; {
                console.log("!!!!2:", res.modifiedCount, res.upsertedId, res.upsertedCount, res.matchedCount);
                return res.matchedCount;
            })
            .catch(e =&gt; console.log(e))
    })
    .catch(e =&gt; console.log(e))
</code></pre>

<p><br>
Using <code>upsert</code> in the second query, it creates the array field if it doesn't exist but then when <code>array.counter</code> reaches 3 in subsequent calls to increase its value, the operation creates a new sub-document in the array with the same values for <code>array.key_2</code> and <code>array.date</code>, effectible duplicating the entry although with <code>array.counter</code> set to 1 instead of 3.</p>

<p>I'm using mongo version 4.2.1</p>

<p><strong>Update:</strong></p>

<p>Below there is a sample document before trying to run the operation on the second subdocument: </p>

<pre><code>{
  "key_1": 1,
  "array": [
    {
      "key_2": 1,
      "counter" 1
    }, {
      "key_2": 2,
      "counter" 3
    }
  ]
}
</code></pre>

<p>This is what I'm getting as a result when using <code>upsert</code>:</p>

<pre><code>{
  "key_1": 1,
  "array": [
    {
      "key_2": 1,
      "counter" 1
    }, {
      "key_2": 2,
      "counter" 3
    }, {
      "key_2": 2,
      "counter" 1
    }
  ]
}
</code></pre>

<p><br>
The operation is duplicating the second subdocument in array, but if <code>upsert</code> is not used then the array field is not created if it's not already in the parent document, which is the oposite of the expected behavior for <code>$addToSet</code> from what it says in the documentation.</p>

<p><strong>Update 2</strong></p>

<p>These are the steps to reproduce the issue:</p>

<p>Run the operation with <code>key_1</code> set to 1, and <code>upsert</code> disabled. None of the queries modifies the document. The <code>array</code> field is not created.</p>

<pre><code>{
  "key_1": 1
}
</code></pre>

<p>Enable <code>upsert</code> and run the operation again. The <code>array</code> field is created in the second query:</p>

<pre><code>{
  "key_1": 1,
  "array": [
    {
      "key_2": 1,
      "counter" 1
    }
  ]
}
</code></pre>

<p>Run the operation again twice more. The first query modifies the document twice:</p>

<pre><code>{
  "key_1": 1,
  "array": [
    {
      "key_2": 1,
      "counter" 3
    }
  ]
}
</code></pre>

<p>Run the operation once more. The first query doesn't modifies the document. The second query creates a duplicate:</p>

<pre><code>{
  "key_1": 1,
  "array": [
    {
      "key_2": 1,
      "counter" 3
    }, {
      "key_2": 1,
      "counter" 1
    }
  ]
}
</code></pre>

